	'messages:config-welcome' => 'fi:MediaWiki on vapaa, avoimen lähdekoodin wikiohjelmistopaketti, joka on kirjoitettu PHP:llä. Se toimii alustana Wikipedialle ja muille Wikimedian hankkeille, joita sadat miljoonat ihmiset käyttävät kuukausittain. MediaWiki on käännetty yli 350 kielelle, ja sen luotettavuus sekä vankat ominaisuusjoukot ovat ansainneet sille suuren ja eloisan yhteisön kolmansien osapuolten käyttäjiä ja kehittäjiä.
=== Ympäristötarkastukset ===
Perustarkastaksut suoritetaan nyt sen selvittämiseksi, sopiiko tämä ympäristö MediaWikin asennukseen.
