	'messages:api-help-param-continue' => 'en:When more results are available, use this to continue. More detailed information on how to continue queries [[mw:Special:MyLanguage/API:Continue|can be found on mediawiki.org]].',
	'messages:api-help-param-no-description' => 'en:<span class="apihelp-empty">(no description)</span>',
