	'messages:config-pcre-invalid-newline' => 'en:<strong>Fatal:</strong> The PCRE2 library seems to be compiled with <code>--enable-newline-is-any</code>.
MediaWiki is not compatible with this configuration.',
	'messages:config-mod-security' => 'en:<strong>Warning:</strong> Your web server has [https://modsecurity.org/ mod_security]/mod_security2 enabled. Many common configurations of this will cause problems for MediaWiki and other software that allows users to post arbitrary content.
If possible, this should be disabled. Otherwise, refer to [https://modsecurity.org/documentation/ mod_security documentation] or contact your host\'s support if you encounter random errors.',
	'messages:config-uploads-security-headers' => 'en:<strong>Warning:</strong> Requests for images in your uploads directory should answer with the HTTP header <code>$1</code> to protect browsers from potentially unsafe files.
It is highly recommended to [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security#Upload_security configure appropriate response headers on your webserver] before enabling uploads.',
	'messages:config-uploads-security-requesterror' => 'en:<strong>Warning:</strong> Because of a connection error, it was not possibly to verify that images in your uploads directory, respond with the HTTP header <code>$1</code> to protect browsers from potentially unsafe files.
It is highly recommended to [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security#Upload_security configure appropriate response headers on your webserver] before enabling uploads.',
	'messages:config-using-32bit' => 'en:<strong>Warning:</strong> your system appears to be running with 32-bit integers. This is [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:32-bit not advised].',
	'messages:config-sqlite-parent-unwritable-group' => 'en:Cannot create the data directory <code><nowiki>$1</nowiki></code>, because the parent directory <code><nowiki>$2</nowiki></code> is not writable by the webserver.

The installer has determined the user your webserver is running as.
Make the <code><nowiki>$3</nowiki></code> directory writable by it to continue.
On a Unix/Linux system do:

<pre>cd $2
mkdir $3
chgrp $4 $3
chmod g+w $3</pre>',
	'messages:config-sqlite-parent-unwritable-nogroup' => 'en:Cannot create the data directory <code><nowiki>$1</nowiki></code>, because the parent directory <code><nowiki>$2</nowiki></code> is not writable by the webserver.

The installer could not determine the user your webserver is running as.
Make the <code><nowiki>$3</nowiki></code> directory globally writable by it (and others!) to continue.
On a Unix/Linux system do:

<pre>cd $2
mkdir $3
chmod a+w $3</pre>',
	'messages:config-upgrade-error' => 'en:There was an error while upgrading the MediaWiki tables in your database.

For more information look into the log above, to retry click <strong>Continue</strong>.',
	'messages:config-mysql-engine-help' => 'en:<strong>InnoDB</strong> is almost always the best option, since it has good concurrency support.

<strong>MyISAM</strong> may be faster in single-user or read-only installations.
MyISAM databases tend to get corrupted more often than InnoDB databases.',
	'messages:config-server' => 'en:URL host name:',
	'messages:config-server-help' => 'en:The protocol and host name part of the URL used to access your wiki. The automatically detected default is usually correct.',
	'messages:config-pingback-help' => 'en:If you select this option, MediaWiki will periodically ping https://www.mediawiki.org with basic data about this MediaWiki instance. This data includes, for example, the type of system, PHP version, and chosen database backend. The Wikimedia Foundation shares this data with MediaWiki developers to help guide future development efforts. The following data will be sent for your system:
<pre>$1</pre>

The privacy policy for this feature can be seen at https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement.

For more general information about this feature, see https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgPingback.

For aggregated pingback data, see https://pingback.wmcloud.org/.',
	'messages:config-email-sender-help' => 'en:Enter the email address to use as the return address on outbound email.
This is where bounces will be sent.
Many mail servers require at least the domain name part to be valid.',
	'messages:config-upload-help' => 'en:File uploads potentially expose your server to security risks.
For more information, read the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security security section] in the manual.

To enable file uploads, change the mode on the <code>images</code> subdirectory under MediaWiki\'s root directory so that the web server can write to it.
Then enable this option.',
	'messages:config-logo-summary' => 'en:For each of these fields, you will need to upload an image of the appropriate size, and enter the URL in the boxes below. You can use <code>$wgStylePath</code> or <code>$wgScriptPath</code> if your logo is relative to those paths. You can leave any of these boxes blank.',
	'messages:config-logo-wordmark-help' => 'en:The name of your site. If not defined, this will generally fall back to text. Ideally an SVG with height less than or equal to 30px.',
	'messages:config-logo-tagline-help' => 'en:The tagline of your site. Use only if you have defined a wordmark above. If not defined, this will generally fall back to text. The combined height of the tagline and wordmark as a general rule should not exceed 50px.',
	'messages:config-logo-sidebar-help' => 'en:Some MediaWiki skins include a logo with 160 pixel height as part of the sidebar menu. If undefined, this is the same as the icon defined above. You may want to have a dedicated graphic that combines wordmark and icon.',
	'messages:config-cache-options' => 'en:Settings for object caching:',
	'messages:config-cache-help' => 'en:Object caching is used to improve the speed of MediaWiki by caching frequently used data.
Medium to large sites are highly encouraged to enable this, and small sites will see benefits as well.',
