Otathan huomioon, että kaikkien wikien täytyy noudattaa <a href="https://meta.miraheze.org/wiki/Special:MyLanguage/Content_Policy">isisältökäytäntöä</a> tai ne voidaan sulkea. Wikisi ei myöskään saa poiketa liiaksi sen alkuperäisestä käyttötarkoituksesta, tai se voidaan sulkea.

Kiitos kun valitsit Mirahezen! Toivomme wikiseikkailuillesi kaikkea hyvää!',
